import { useState } from 'react';
import adminService from '../../services/adminService';


function Register() {

    const [data, setdata] = useState();
    const onChangeHandler = (e) => {
      setdata({
        ...data,
        [e.target.name] : e.target.value
      });
      console.log(data);
    };
    const onSubmitHandler = (e) =>{
      e.preventDefault()
      adminService.register(data)


      .then((res)=>{
        console.log(res)
        
      })
      .catch((err)=>{
        console.log(err)
      })
    };
  



    return(
        <>
          <div className="container-scroller">
  <div className="container-fluid page-body-wrapper full-page-wrapper">
    <div className="content-wrapper d-flex align-items-center auth px-0">
      <div className="row w-100 mx-0">
        <div className="col-lg-4 mx-auto">
          <div className="auth-form-light text-left py-5 px-4 px-sm-5">
            <div className="brand-logo">
              <img src="../../images/logo-dark.svg" alt="logo" />
            </div>
            <h4>New here?</h4>
            <h6 className="font-weight-light">Signing up is easy. It only takes a few steps</h6>
            <form className="pt-3"  onSubmit={ onSubmitHandler}>
              <div className="form-group">
                <input type="text" className="form-control form-control-lg" name='Nom' id="exampleInputUsername1"onChange={onChangeHandler}  placeholder="Nom" />
              </div>
              <div className="form-group">
                <input type="text" className="form-control form-control-lg" name='Prenom' id="exampleInputUsername1"onChange={onChangeHandler}  placeholder="Prenom" />
              </div>
              <div className="form-group">
                <input type="email" className="form-control form-control-lg"name="Email" id="exampleInputEmail1" onChange={onChangeHandler}  placeholder="Email" />
              </div>
             
              <div className="form-group">
                <input type="password" className="form-control form-control-lg"  name="password" id="exampleInputPassword1" onChange={onChangeHandler}  placeholder="Password" />
              </div>

              <div className="form-group">
                <input type="number" className="form-control form-control-lg"  name="CIN" id="exampleInputphone" onChange={onChangeHandler}  placeholder="CIN" />
              </div>
              <div className="form-group">
                <input type="number" className="form-control form-control-lg"  name=" NumTel" id="exampleInputphone" onChange={onChangeHandler}  placeholder=" NumTel" />
              </div>
              <div className="form-group">
                <input type="number" className="form-control form-control-lg"  name=" CodePostal" id="exampleInputphone" onChange={onChangeHandler}  placeholder="CodePostal" />
              </div>

              <div className="form-group">
                <input type="text" className="form-control form-control-lg"  name=" Ville" id="exampleInputphone" onChange={onChangeHandler}  placeholder="Ville" />
              </div>

              <div className="form-group">
                <input type="text" className="form-control form-control-lg"  name=" Pays" id="exampleInputphone" onChange={onChangeHandler}  placeholder="Pays" />
              </div>


              <div className="form-group">
                <input type="text" className="form-control form-control-lg"  name="Address" id="exampleInputphone" onChange={onChangeHandler}  placeholder="Address" />
              </div>
              
              
              <button type="submit" className="btn btn-primary mr-2">SIGN UP</button>

             {/*  <div className="mt-3">
                <a className="btn btn-block btn-primary btn-lg font-weight-medium auth-form-btn" onClick={onSubmitHandler} ></a>
              </div> */}
              <div className="text-center mt-4 font-weight-light">
                Already have an account? <a href="login.html" className="text-primary">Login</a>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
    {/* content-wrapper ends */}
  </div>
  {/* page-body-wrapper ends */}
</div>

        </>
    );
}

export default Register;
